import React from "react";
import { Header } from "./Header";
import styled from "styled-components";

const Wrapper = styled.div`
margin: 20,
padding: 20,
border: "1px solid #DDD"
`;

export const Layout: React.FC = props => {
  return (
    <Wrapper>
      <Header />
      {props.children}
    </Wrapper>
  );
};
